import React from 'react'

const About = () => {
  return (
    <div className='bg-red-300 border shadow-lg'>
        <h1>About</h1>
        <div className='container mx-auto border shadow-lg'></div>
        <div className='container mx-auto border shadow-lg flex'></div>
    </div>
  )
}

export default About;
